Imam sledeč problem. Naredil sem nek app, ki uporablja za pošiljanje smsov mobitelov wsdl. V eclipse sem uvozil wsdl ki mi generira classe, katere potem uporabljam za pošiljanje smsov. V eclipse vse deluje ok, problem imam kako potem to zagnati v cmdju.  Struktura je sledeča. Projekt ______|- src __________|- Test.java __________|- MojObjekt.java __________|- si ____________|- mobitel ________________|- MobiDesktop (tu noter so potem java classi od wsdlja) __________|- Md (še ostali del classov od mobitela)  Spodaj sem dodal še dele kode. Zdaj pa bi jaz to rad preselil na nek drug računalnik, kjer bi zadeva tekla. Se že nekaj časa zajebavam samo še nisem uspel pognati iz cmdja. Vem da je dokaj trivialno samo ne gre :( Če ima kdo 1 min časa bi ga lepo prosil za pomoč.    Koda   public class MojObjekt{

